		((self_in_concretizeAddCqR->machineCode))[3] = ((((usqInt) value) >> 16) & 255);
		((self_in_concretizeAddCqR->machineCode))[4] = ((((usqInt) value) >> 24) & 255);
		return (self_in_concretizeAddCqR->machineCodeSize) = 5;
