/*	Get the size of the non-immediate object in sourceReg into destReg using
	formatReg and scratchReg as temps. None of these registers can overlap.
	Answer the jump
	taken if the object in sourceReg is not indexable. Hack: If the object hs
	a pointer
	format other than 2 leave the number of fixed fields in formatReg. Used by
	primitiveSize, primitiveAt, primitiveAtPut, primitiveStringAt &
	primitiveStringAtPut  */
/*	c.f. StackInterpreter>>stSizeOf: lengthOf:baseHeader:format:
	fixedFieldsOf:format:length: 
 */
/*	and one wonders why Squeak V1 through V3 are slow... */

static AbstractInstruction *
genGetSizeOfintoformatRegscratchReg(sqInt sourceReg, sqInt destReg, sqInt formatReg, sqInt scratchReg)
{
    AbstractInstruction *jmpFmtGe8;
    AbstractInstruction *jumpFmtIs2;
    AbstractInstruction *jumpFmtLe4;
    AbstractInstruction *jumpGotByteSize;
    AbstractInstruction *jumpGotWordSize;
    AbstractInstruction *jumpNotIndexable;
    AbstractInstruction *jumpShortHeader;
    AbstractInstruction *jumpSkip;

	gMoveMwrR(0, sourceReg, formatReg);
	gMoveRR(formatReg, destReg);
	gLogicalShiftRightCqR(8, formatReg);
	gAndCqR(15, formatReg);
	gCmpCqR(2, formatReg);
	jumpNotIndexable = gJumpLess(0);
	gMoveRR(destReg, scratchReg);
	gAndCqR(TypeMask, scratchReg);
	gCmpCqR(HeaderTypeSizeAndClass, scratchReg);
	jumpShortHeader = gJumpNonZero(0);
	assert(Size4Bit == 0);
	gMoveMwrR(0 - (2 * BytesPerWord), sourceReg, destReg);
	gAndCqR(((sqInt) LongSizeMask), destReg);
	jumpSkip = gJump(0);
	jmpTarget(jumpShortHeader, gAndCqR(SizeMask, destReg));
	jmpTarget(jumpSkip, gSubCqR(BaseHeaderSize, destReg));
	gCmpCqR(4, formatReg);
	jumpFmtLe4 = gJumpLessOrEqual(0);
	gCmpCqR(8, formatReg);
	jmpFmtGe8 = gJumpLess(0);
	gAndCqR(3, formatReg);
	gSubRR(formatReg, destReg);
	jumpGotByteSize = gJump(0);
	jmpTarget(jmpFmtGe8, gLogicalShiftRightCqR(2, destReg));
	jumpGotWordSize = gJump(0);
	jmpTarget(jumpFmtLe4, gLabel());
	gLogicalShiftRightCqR(ShiftForWord, destReg);
	gCmpCqR(2, formatReg);
	jumpFmtIs2 = gJumpZero(0);
	genGetFixedFieldsOfPointerNonIntintoscratchReg(sourceReg, formatReg, scratchReg);
	gSubRR(formatReg, destReg);
	jmpTarget(jumpFmtIs2, jmpTarget(jumpGotWordSize, jmpTarget(jumpGotByteSize, gLabel())));
	return jumpNotIndexable;
}


/*	Generate the abort for a PIC. This abort performs either a call of
	ceInterpretMethodFromPIC:receiver: to handle invoking an uncogged
	target or a call of ceMNUFromPICMNUMethod:receiver: to handle an
	MNU dispatch in a closed PIC. It distinguishes the two by testing
	ClassReg. If the register is zero then this is an MNU. */

static sqInt
genInnerPICAbortTrampoline(char *name)
{
    AbstractInstruction *jumpMNUCase;

	gCmpCqR(0, ClassReg);
	jumpMNUCase = gJumpZero(0);
	compileTrampolineForcallJumpBarnumArgsargargargargsaveRegsresultReg(ceInterpretMethodFromPICreceiver, 1, 2, SendNumArgsReg, ReceiverResultReg, null, null, 0, null);
	jmpTarget(jumpMNUCase, gLabel());
	return genTrampolineForcalledcallJumpBarnumArgsargargargargsaveRegsresultRegappendOpcodes(ceMNUFromPICMNUMethodreceiver, name, 1, 2, SendNumArgsReg, ReceiverResultReg, null, null, 0, null, 1);
}


/*	c.f. StackInterpreter>>stSizeOf: lengthOf:baseHeader:format:
	fixedFieldsOf:format:length: 
 */

static sqInt
genInnerPrimitiveAt(sqInt retNoffset)
{
    AbstractInstruction *jumpBounds;
    AbstractInstruction *jumpFmtEq2;
    AbstractInstruction *jumpFmtGt4;
    AbstractInstruction *jumpFmtLt8;
    AbstractInstruction *jumpLarge;
    AbstractInstruction *jumpNotIndexable;
    AbstractInstruction *jumpNotSI;
    AbstractInstruction *jumpSI;

	gMoveRR(ReceiverResultReg, TempReg);
	jumpSI = genJumpSmallIntegerInScratchReg(TempReg);
	gMoveRR(Arg0Reg, TempReg);
	gMoveRR(Arg0Reg, Arg1Reg);
	jumpNotSI = genJumpNotSmallIntegerInScratchReg(TempReg);
	jumpNotIndexable = genGetSizeOfintoformatRegscratchReg(ReceiverResultReg, ClassReg, SendNumArgsReg, TempReg);
	genConvertSmallIntegerToIntegerInScratchReg(Arg1Reg);
	gSubCqR(1, Arg1Reg);
	gCmpRR(ClassReg, Arg1Reg);

	/* This is tedious.  Because of register pressure on x86 (and the baroque
	 complexity of the size computation) we have to recompute the format
	 because it may have been smashed computing the fixed fields.  But at
	 least we have the fixed fields, if any, in formatReg and recomputing
	 these is more expensive than recomputing format.  In any case this
	 should still be faster than the interpreter and we hope this object
	 representation's days are numbered. */

	jumpBounds = gJumpAboveOrEqual(0);
	gMoveMwrR(0, ReceiverResultReg, ClassReg);
	gLogicalShiftRightCqR(8, ClassReg);
	gAndCqR(15, ClassReg);
	gCmpCqR(4, ClassReg);
	jumpFmtGt4 = gJumpGreater(0);
	gCmpCqR(2, ClassReg);
	jumpFmtEq2 = gJumpZero(0);
	gAddRR(SendNumArgsReg, Arg1Reg);
	jmpTarget(jumpFmtEq2, gLabel());
	gAddCqR(((sqInt) BaseHeaderSize >> 2), Arg1Reg);
	gMoveXwrRR(Arg1Reg, ReceiverResultReg, ReceiverResultReg);
	gRetN(retNoffset);
	jmpTarget(jumpFmtGt4, gLabel());
	gCmpCqR(8, ClassReg);
	jumpFmtLt8 = gJumpLess(0);
	gAddCqR(BaseHeaderSize, Arg1Reg);
	gMoveXbrRR(Arg1Reg, ReceiverResultReg, ReceiverResultReg);
	genConvertIntegerToSmallIntegerInScratchReg(ReceiverResultReg);
	gRetN(retNoffset);
	jmpTarget(jumpFmtLt8, gLabel());
	assert(BytesPerWord == 4);
	gAddCqR(((sqInt) BaseHeaderSize >> 2), Arg1Reg);
	gMoveXwrRR(Arg1Reg, ReceiverResultReg, ReceiverResultReg);
	gCmpCqR(1073741823, ReceiverResultReg);
	jumpLarge = gJumpAbove(0);
	genConvertIntegerToSmallIntegerInScratchReg(ReceiverResultReg);
	gRetN(retNoffset);
	jmpTarget(jumpLarge, CallRT(cePositive32BitIntegerTrampoline()));
	gMoveRR(TempReg, ReceiverResultReg);
	gRetN(retNoffset);
	jmpTarget(jumpSI, jmpTarget(jumpNotSI, jmpTarget(jumpNotIndexable, jmpTarget(jumpBounds, gLabel()))));
	return 0;
}


/*	c.f. StackInterpreter>>stSizeOf: lengthOf:baseHeader:format:
	fixedFieldsOf:format:length: 
 */

static sqInt
genInnerPrimitiveSize(sqInt retNoffset)
{
    AbstractInstruction *jumpNotIndexable;
    AbstractInstruction *jumpNotSI;

	gMoveRR(ReceiverResultReg, TempReg);
	jumpNotSI = genJumpSmallIntegerInScratchReg(TempReg);
	jumpNotIndexable = genGetSizeOfintoformatRegscratchReg(ReceiverResultReg, ClassReg, SendNumArgsReg, TempReg);
	genConvertIntegerToSmallIntegerInScratchReg(ClassReg);
	gMoveRR(ClassReg, ReceiverResultReg);
	flag("currently caller pushes result");
	gRetN(retNoffset);
	jmpTarget(jumpNotSI, jmpTarget(jumpNotIndexable, gLabel()));
	return 0;
}


/*	c.f. StackInterpreter>>stSizeOf: lengthOf:baseHeader:format:
	fixedFieldsOf:format:length: 
 */

static sqInt
genInnerPrimitiveStringAt(sqInt retNOffset)
{
    AbstractInstruction *jumpBounds;
    AbstractInstruction *jumpNotByteIndexable;
    AbstractInstruction *jumpNotSI;
    AbstractInstruction *jumpShortHeader;
    AbstractInstruction *jumpSI;
    AbstractInstruction *jumpSkip;

	gMoveRR(ReceiverResultReg, TempReg);
	jumpSI = genJumpSmallIntegerInScratchReg(TempReg);
	gMoveRR(Arg0Reg, TempReg);
	gMoveRR(Arg0Reg, Arg1Reg);
	jumpNotSI = genJumpNotSmallIntegerInScratchReg(TempReg);
	gMoveMwrR(0, ReceiverResultReg, TempReg);
	gMoveRR(TempReg, ClassReg);
	gLogicalShiftRightCqR(8, TempReg);
	gAndCqR(15, TempReg);
	gMoveRR(TempReg, SendNumArgsReg);
	gAndCqR(3, SendNumArgsReg);
	gSubRR(SendNumArgsReg, TempReg);
	gCmpCqR(8, TempReg);
	jumpNotByteIndexable = gJumpNonZero(0);
	gMoveRR(ClassReg, TempReg);
	gAndCqR(TypeMask, TempReg);
	gCmpCqR(HeaderTypeSizeAndClass, TempReg);
	jumpShortHeader = gJumpNonZero(0);
	assert(Size4Bit == 0);
	gMoveMwrR(0 - (2 * BytesPerWord), ReceiverResultReg, ClassReg);
	gAndCqR(((sqInt) LongSizeMask), ClassReg);
	jumpSkip = gJump(0);
	jmpTarget(jumpShortHeader, gAndCqR(SizeMask, ClassReg));
	jmpTarget(jumpSkip, gSubCqR(BaseHeaderSize, ClassReg));
	gSubRR(SendNumArgsReg, ClassReg);
	genConvertSmallIntegerToIntegerInScratchReg(Arg1Reg);
	gSubCqR(1, Arg1Reg);
	gCmpRR(ClassReg, Arg1Reg);
	jumpBounds = gJumpAboveOrEqual(0);
	gAddCqR(BaseHeaderSize, Arg1Reg);
	annotateobjRef(gMoveCwR(characterTable(), Arg0Reg), characterTable());
	gMoveXbrRR(Arg1Reg, ReceiverResultReg, ReceiverResultReg);
	gAddCqR(((sqInt) BaseHeaderSize >> 2), ReceiverResultReg);
	gMoveXwrRR(ReceiverResultReg, Arg0Reg, ReceiverResultReg);
	gRetN(retNOffset);
	jmpTarget(jumpSI, jmpTarget(jumpNotSI, jmpTarget(jumpNotByteIndexable, jmpTarget(jumpBounds, gLabel()))));
	return 0;
}

