			gMoveMwrR(BytesPerWord * 2, SPReg, TempReg);
			gPushR(TempReg);
			gMoveMwrR(BytesPerWord * 2, SPReg, TempReg);
			gPushR(TempReg);
			gMoveRMwr(ReceiverResultReg, 4 * BytesPerWord, SPReg);
			gMoveRMwr(Arg0Reg, 3 * BytesPerWord, SPReg);
