static sqInt
genStoreSourceRegslotIndexdestRegscratchReg(sqInt sourceReg, sqInt index, sqInt destReg, sqInt scratchReg)
{
    AbstractInstruction *jmpAlreadyRoot;
    AbstractInstruction *jmpDestYoung;
    AbstractInstruction *jmpImmediate;
    AbstractInstruction *jmpSourceOld;
    sqInt mask;
    sqInt rootBitByteOffset;

	gMoveRMwr(sourceReg, (index * BytesPerWord) + BaseHeaderSize, destReg);
	gMoveRR(sourceReg, scratchReg);
	gAndCqR(1, scratchReg);

	/* Get the old/new boundary in scratchReg */

	jmpImmediate = gJumpNonZero(0);
	gMoveAwR(youngStartAddress(), scratchReg);
	gCmpRR(scratchReg, destReg);

	/* Is value stored old?  If so we're done. */

	jmpDestYoung = gJumpAboveOrEqual(0);
	gCmpRR(scratchReg, sourceReg);

	/* value is young and target is old.
	 Need to make this a root if the root bit is not already set.
	 Test the root bit.  Only need to fetch the byte containing it,
	 which reduces the size of the mask constant. */

	jmpSourceOld = gJumpBelow(0);
	rootBitByteOffset = (isBigEndian(jmpSourceOld)
		? BytesPerWord - RootBitDigitLength
		: RootBitDigitLength - 1);
	mask = (RootBitDigitLength > 1
		? ((usqInt) RootBit) >> ((RootBitDigitLength - 1) * 8)
		: RootBit);
	gMoveMbrR(rootBitByteOffset, destReg, scratchReg);
	gAndCqR(mask, scratchReg);

	/* Root bit is not set.  Call store check to insert dest into root table. */

	jmpAlreadyRoot = gJumpNonZero(0);
	assert(destReg == ReceiverResultReg);
	CallRT(ceStoreCheckTrampoline());
	jmpTarget(jmpImmediate, jmpTarget(jmpDestYoung, jmpTarget(jmpSourceOld, jmpTarget(jmpAlreadyRoot, gLabel()))));
	return 0;
}

