/*	Unlink all sends in cog methods. */

void
unlinkSendsOf(sqInt selector)
{
    CogMethod *cogMethod;

	if (methodZoneBase == null) {
		return;
	}

	/* First check if any method actually has the selector; if not there can't
	 be any linked send to it. */

	cogMethod = ((CogMethod *) methodZoneBase);
	while ((cogMethod < (limitZony()))
 && (((cogMethod->selector)) != selector)) {
		cogMethod = methodAfter(cogMethod);
	}
	if (cogMethod >= (limitZony())) {
		return;
	}
	codeModified = 0;
	cogMethod = ((CogMethod *) methodZoneBase);
	while (cogMethod < (limitZony())) {
		if (((cogMethod->cmType)) == CMMethod) {
			mapForperformUntilarg(cogMethod, unlinkIfLinkedSendpcof, selector);
		}
		else {
			if ((((cogMethod->cmType)) != CMFree)
			 && (((cogMethod->selector)) == selector)) {
				freeMethod(cogMethod);
			}
		}
		cogMethod = methodAfter(cogMethod);
	}
	if (codeModified) {
		flushICacheFromto(processor, methodZoneBase, ((sqInt)(limitZony())));
	}
}


/*	Unlink all sends in cog methods to free methods and/or pics. */

void
unlinkSendsToFree(void)
{
    CogMethod *cogMethod;

	if (methodZoneBase == null) {
		return;
	}
	codeModified = 0;
	cogMethod = ((CogMethod *) methodZoneBase);
	while (cogMethod < (limitZony())) {
		if (((cogMethod->cmType)) == CMMethod) {
			mapForperformUntilarg(cogMethod, unlinkIfLinkedSendToFreepcignored, 0);
		}
		else {
			if (((cogMethod->cmType)) == CMClosedPIC) {
				assert(noTargetsFreeInClosedPIC(cogMethod));
			}
		}
		cogMethod = methodAfter(cogMethod);
	}
	if (codeModified) {
		flushICacheFromto(processor, methodZoneBase, ((sqInt)(limitZony())));
	}
}


/*	Unlink all sends in cog methods to a particular target method. */

void
unlinkSendsTo(CogMethod *targetMethod)
{
    CogMethod *cogMethod;
    sqInt freedPIC;

	if (methodZoneBase == null) {
		return;
	}
	codeModified = freedPIC = 0;
	cogMethod = ((CogMethod *) methodZoneBase);
	while (cogMethod < (limitZony())) {
		if (((cogMethod->cmType)) == CMMethod) {
			mapForperformUntilarg(cogMethod, unlinkIfLinkedSendpcto, ((sqInt)targetMethod));
		}
		else {
			if ((((cogMethod->cmType)) == CMClosedPIC)
			 && (cPICHasTarget(cogMethod, targetMethod))) {
				freeMethod(cogMethod);
				freedPIC = 1;
			}
		}
		cogMethod = methodAfter(cogMethod);
	}
	if (freedPIC) {
		unlinkSendsToFree();
	}
	else {
		if (codeModified) {
			flushICacheFromto(processor, methodZoneBase, ((sqInt)(limitZony())));
		}
	}
}

